VimpProgressBar={init:(a,b)=>{let c=setInterval(()=>{VimpProgressBar.updateProgress(a,b,a=>{a&&"100%"!==a||clearInterval(c)})},5e3)},updateProgress:(a,b,c)=>{VimpProgressBar.getProgress(a,b,b=>{$("#xvmp_progress_"+a).text(b+"%"),$("#xvmp_progress_bar_"+a).css("width",b+"%").attr("aria-valuenow",b),c(b)})},getProgress:(a,b,c)=>{$.get(b.replace(/&amp;/g,"&"),a=>{c(a)})}};